  ioString.appendSigned (inElementIndex) ;
  ioString << ":" << mInfo.mCategoryMethodKind.reader_description (inIndentation + 1) ;
  ioString << "\n" ;
  ioString.writeStringMultiple ("| ", inIndentation) ;
  ioString << "|-value " ;
  ioString.appendSigned (inElementIndex) ;
